import React from "react";
<script src="https://cdnjs.cloudflare.com/ajax/libs/howler/2.2.1/howler.min.js"></script>;
export default function Phonetic(props) {
  return (
    <div className="Phonetic">
      <audio controls>
        <source src={props.phonetic.audio} />
        Listen
      </audio>
      <br />
      {props.phonetic.text}
    </div>
  );
}
